  return (
    <div className={classes.row}>
      <Row>
        <Col>
          <img src={props.photoUrl} alt="Property" height="100px"></img>
        </Col>
        <Col>
          <h3>{props.name}</h3>
          <p>{props.city}</p>
          <p>{props.address}</p>
          <Button variant="outline-primary">Show on map</Button>
        </Col>
        <Col>
          <h3>{props.price}â‚¬</h3>
        </Col>
      </Row>
    </div>
  );
};

